const toUserId = (v) => {
    if (v == null) return "NO_USER_FOUND";
    if (typeof v === "object") return v._id;
    else return v;
}

const toPlaceId = (v) => {
    if (v == null) return "NO_PLACE_FOUND";
    if (typeof v === "object") return v._id;
    else return v;
}

const toDistance = (coors1, coors2) => {
    const { lat: lat1, lng: lon1 } = coors1;
    const { lat: lat2, lng: lon2 } = coors2;
    const toRadians = (deg) => deg * (Math.PI / 180);
    const R = 6371;
    const φ1 = toRadians(lat1);
    const φ2 = toRadians(lat2);
    const Δφ = toRadians(lat2 - lat1);
    const Δλ = toRadians(lon2 - lon1);
    const a = Math.sin(Δφ / 2) * Math.sin(Δφ / 2) +
        Math.cos(φ1) * Math.cos(φ2) *
        Math.sin(Δλ / 2) * Math.sin(Δλ / 2);
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
    const distance = R * c;
    return distance;
}

const isCorrectOrder = (arr, order) => {
    if (order === -1) {
        return arr.sort((a, b) => a > b).join("|") === arr.join("|");
    }
    if (order === 1) {
        return arr.sort((a, b) => a < b).join("|") === arr.join("|");
    }
    return true;
}

const isCorrectAddedBy = (data, addedBy) => {
    if (addedBy == null || addedBy.length === 0) return true;
    let result = false;
    // Personal
    if (addedBy.includes(0)) {
        result ||= data.place == null;
    }
    if (data.place != null && typeof data.place === "object") {
        result ||= addedBy.includes(data.place.type);
    }

    return result;
}


